svg.script:
  function toHtml(parent, frag) {
    var reg = new RegExp("_br_|_plus_|_minus_|_super_(.*)_endsuper_|_sub_(.*)_endsub_", "g");
    // Literal regexp may not work!
    var start = 0;
    for(var matched; (matched = reg.exec(frag)) != null; ) {
      var left = RegExp.leftContext.substring(start);
      parent.appendChild(document.createTextNode(left));
      var el;
      if(matched[0] == "_br_") {
        el = document.createElementNS("http://www.w3.org/1999/xhtml","br");
      } else if(matched[0] == "_plus_") {
        el = document.createTextNode("+");
      } else if(matched[0] == "_minus_") {
        el = document.createTextNode("-");
      } else if(matched[0].indexOf("_super_") == 0) {
        el = toHtml(document.createElementNS("http://www.w3.org/1999/xhtml","sup"), matched[1]);
      } else if(matched[0].indexOf("_sub_") == 0) {
        el = toHtml(document.createElementNS("http://www.w3.org/1999/xhtml","sub"), matched[2]);
      }
      parent.appendChild(el);
      start = reg.lastIndex;
    }
    parent.appendChild(document.createTextNode(frag.substring(start)));
    return parent;
  }

  function enrich(parent) {
    var container = parent.getElementsByTagName("body")[0];
    var content = container.firstChild.nodeValue;
    var rich = toHtml(document.createElementNS("http://www.w3.org/1999/xhtml","div"), content);
    container.replaceChild(rich, container.firstChild);
  }

  function enrichText(container) {
    if(container == null) return;
    var frag = container.firstChild;
    container.removeChild(frag);
    toHtml(container, frag.nodeValue);
  }

  function enrichAll(container) {
    if(container == null || !container.hasChildNodes()) return;
    for(var child = container.firstChild; child != null; child = child.nextSibling) {
      if(child.nodeType == 1) { // ELEMENT_NODE
        enrichAll(child); // recursive
      } else if(child.nodeType == 3) { // TEXT_NODE
        var span = document.createElementNS("http://www.w3.org/1999/xhtml","span");
        var rich = toHtml(span, child.nodeValue);
        container.replaceChild(rich, child);
      }
    }
  }
